import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Student Detection System</h1>
        <p>Testing minimal setup...</p>
      </div>
    </Router>
  );
}

export default App;
